import React, { useState, useEffect } from "react";
import {
  Box,
  Heading,
  Text,
  Button,
  VStack,
  Divider,
  useColorModeValue,
} from "@chakra-ui/react";

function RandomPickerPage() {
  const [teams, setTeams] = useState([]);
  const [history, setHistory] = useState([]);
  const [randomTeam, setRandomTeam] = useState(null);

  const cardBg = useColorModeValue("gray.100", "gray.700");

  // Fetch teams from backend
  useEffect(() => {
    const fetchTeams = async () => {
      try {
        const response = await fetch("http://localhost:5000/teams");
        const data = await response.json();
        setTeams(data.activeTeams || []); // Echipele disponibile
        setHistory(data.selectedTeams || []); // Istoricul echipelor selectate
      } catch (error) {
        console.error("Failed to fetch teams:", error);
      }
    };

    fetchTeams();
  }, []);

  const handleTeamSelect = async () => {
    try {
      const response = await fetch("http://localhost:5000/random", {
        method: "POST",
      });
      const data = await response.json();

      setRandomTeam(data.selectedTeam || null); // Echipa selectatÄƒ
      setTeams(data.remainingTeams || []); // Echipele rÄƒmase
      setHistory(data.selectedTeams || []); // Actualizare istoric
    } catch (error) {
      console.error("Failed to select a team:", error);
    }
  };

  const handleReset = async () => {
    try {
      const response = await fetch("http://localhost:5000/teams");
      const data = await response.json();
      setTeams(data.activeTeams || []); // ReseteazÄƒ echipele disponibile
      setHistory([]); // ReseteazÄƒ istoricul
      setRandomTeam(null); // ReseteazÄƒ echipa selectatÄƒ
    } catch (error) {
      console.error("Failed to reset teams:", error);
    }
  };

  return (
    <Box p={8}>
      <Heading mb={4} color={useColorModeValue("teal.600", "teal.300")}>
        ðŸŽ¯ Random Picker
      </Heading>

      {/* AfiÈ™Äƒm echipele disponibile */}
      <VStack spacing={4} align="stretch" mb={6}>
        <Heading size="md">Available Teams:</Heading>
        {teams.length > 0 ? (
          teams.map((team) => (
            <Box
              key={team.id}
              p={4}
              bg={cardBg}
              borderRadius="md"
              boxShadow="md"
            >
              <Text fontWeight="bold">{team.name}</Text>
            </Box>
          ))
        ) : (
          <Text>No teams available.</Text>
        )}
      </VStack>

      {/* Echipa selectatÄƒ */}
      {randomTeam && (
        <Text fontSize="xl" fontWeight="bold" color="green.500" mb={4}>
          Selected Team: {randomTeam.name}
        </Text>
      )}

      <Divider mb={6} />

      {/* Butoane */}
      <VStack spacing={4}>
        <Button colorScheme="blue" onClick={handleTeamSelect} isDisabled={teams.length === 0}>
          Select Random Team
        </Button>
        <Button colorScheme="red" onClick={handleReset}>
          Reset Teams
        </Button>
      </VStack>

      {/* Istoric */}
      <VStack spacing={4} align="stretch" mt={8}>
        <Heading size="md">Selected Teams History:</Heading>
        {history.length > 0 ? (
          history.map((entry, index) => (
            <Box
              key={index}
              p={4}
              bg={useColorModeValue("orange.100", "orange.700")}
              borderRadius="md"
              boxShadow="md"
            >
              <Text fontWeight="bold">{entry.name}</Text>
            </Box>
          ))
        ) : (
          <Text>No history available.</Text>
        )}
      </VStack>
    </Box>
  );
}

export default RandomPickerPage;
